def palindrome_of_length_at_least_n(s):
    palindromes = set()
    s = ''.join([c for c in s if c.isalpha()]).lower()
    for i in range(len(s)):
        for j in range(i+20, len(s)+1):
            substring = s[i:j]
            if substring == substring[::-1]:
                palindromes.add(substring)
    return palindromes
